      config.plugins.push(
        new BugsnagSourceMapUploaderPlugin({
          apiKey: process.env.NEXT_PUBLIC_BUGSNAG_KEY ?? "",
          overwrite: true,
          publicPath: `https://${process.env.VERCEL_URL ?? "guild.xyz"}/_next/`,
